B.Cg=A.a(s(["Na mijn middelbare school ben ik eerst de opleiding Industri\xeble Ingenieurswetenschappen begonnen aan de Universiteit van Hasselt. Dit was een richting met veel verschillende vakken. Na het eerste semester ben ik erachter gekomen dat de meeste vakken me niet echt fascineerden, behalve de vakken Java en Python. Deze waren de enige vakken die ik echt boeiend vond dus heb ik na het eerste semester besloten om over te schakelen naar de richting Toegepaste Informatica aan de Hogeschool PXL in Hasselt. Ik voelde me onmiddellijk thuis in deze richting en ben heel dankbaar dat ik deze beslissing genomen heb.","Na 3 jaar op de Hogeschool PXL gestudeerd te hebben, ben ik sterk gegroeid als persoon en heb ik mijn technische skills in de IT-wereld sterk ontwikkeld.  Ik ben de Hogeschool PXL dan ook enorm dankbaar dat ik mezelf heb kunnen ontwikkelen in deze 3 jaren boordevol interessante en leerrijke lessen, activiteiten en projecten. Dankzij PXL waren dit geen saaie jaren, maar heb ik me op een gevarieerde manier kunnen opwikkelen tot een volwaardig persoon die voldoet aan alle pijlers van de PXL X-factor. Ik heb mogen deelnemen aan toffe projecten zoals het IT-Project, leerrijke seminaries naar keuze en leuke evenementen zoals de PXL Hackathon. Vaak waren de projecten ook in (multidisciplinaire) groepen, waar de goede samenwerking tussen mede-juniorcollega\u2019s een must was. Ik heb hier veel uit geleerd en weet nu meer dan ooit mijn weg te vinden binnen professionele teams.","De hogeschool organiseerde ook jaarlijks het PXL-jobevent, waar ik met veel plezier gebruik van heb gemaakt om een netwerk te leggen binnen de IT-wereld. Dankzij dit jobevent ben ik in contact gekomen met IT Licious, het bedrijf waarbij ik in mijn laatste jaar stage heb gedaan en krijg al veel jobaanbiedingen, zelfs v\xf3\xf3r ik afgestudeerd ben. Na deze beurs heb ik dan ook zelf het initiatief genomen om contact te op te nemen met IT Licious. Dit heeft er uiteindelijk ook voor gezorgd dat ik een stageplaats bij hen heb gekregen.","Mijn hobby als game developer heeft het meeste meerwaarde voor de X-Factor pijlers. In de zomer van 2021 heb ik zelf het initiatief genomen om mijn kennis uit te breiden met een leuke maar ook leerrijke hobby. Ik ben gestart met het volgen van online YouTube-cursussen om me in deze nieuwe discipline te verdiepen. Deze hobby is later uitgegroeid tot een echte passie. Mijn vakantiedagen waren regelmatig volledig gevuld met het ontwikkelen van games. Wanneer ik een game aan het ontwikkelen ben, kan ik me volledig uitleven in mijn eigen creativiteit en wil ik steeds meer verwezenlijken en bijleren.","Aangezien game development voornamelijk een hobby is die ik op mezelf uitvoer, is samenwerking tijdens mijn projecten hier niet rechtstreeks van toepassing. Toch is er wel enige vorm van internationale samenwerking aanwezig binnen de game development community. Deze is het sterkste aanwezig op Reddit waar ik samen met andere game developers vragen stel, beantwoordt en inspiratie kan opdoen door creaties te delen met elkaar. Op deze manier helpen game developers elkaar en motiveren en inspireren we elkaar. Samenwerking is ook naar boven gekomen tijdens de projecten in de opleiding, de stage en de hackathon. Tijdens de PXL Hackathon heb ik in een multidisciplinair team samengewerkt om op een korte tijd een werkend product af te leveren.","Niet alleen mijn hobby als game developer heeft bijgedragen aan de PXL X-factor maar ook alle andere activiteiten in mijn portfolio. Alle seminaries, de hackathon, de game jam, \u2026 hebben allemaal bijgedragen tot de trotse IT-professional die ik me momenteel al voel. Het zijn allemaal bouwstenen die in mijn ontwikkeling hebben geholpen en daar ben ik zeer dankbaar voor."]),t.s)
