B.Cu=A.a(s(["Ik ben Dennis Vermesen, een laatstejaarsstudent toegepaste informatica. Ik ben 21 jaar en woon in Alken. Ik volg de richting toegepaste informatica op de hogeschool PXL in Hasselt en heb gekozen voor full stack applicatieontwikkeling als afstudeerrichting. Momenteel doe ik stage bij een klein bedrijf in Sint-Truiden genaamd IT Licious. Mijn stageopdracht bestaat uit 2 delen. Enerzijds werk ik aan de interne HR-applicatie van IT Licious en anderzijds krijg ik de kans om samen met een collega-stagiair een nieuwe mobiele applicatie te ontwikkelen voor Ondernemers voor een warm Belgi\xeb.","In mijn vrije tijd ben ik nog steeds een even grote IT-fanaticus als tijdens de schooluren. Ik hou me veel bezig met hardware, software en development en probeer hier ook veel over bij te leren. Mijn aanbevolen video\u2019s op YouTube staan dan ook vol met video\u2019s over pc-bouwers, devlogs en development tutorials. Een van mijn grootste hobby\u2019s is game development. Ik hou ervan om zelf games te ontwikkelen en op een creatieve manier technieken en doelstellingen te bedenken om in mijn games toe te passen. Mijn games worden altijd ontwikkeld met de Unity game engine en de programmeertaal C#.","In december 2021 heb ik de uitgebreide Thalento-test afgelegd om een beter beeld te geven van wat mijn profiel is. De resultaten van de test waren zeer realistisch en leunen zeer goed aan bij het beeld dat ik van mezelf heb. Volgens het resulterende rapport ben ik meewerkende teamspeler die zich sterk engageert binnen teamopdrachten zonder daarvoor zelf op de voorgrond te treden. Binnen het team zal ik nooit een overheersende rol opnemen maar in plaats daarvan vind ik onderlinge afstemmingen en overleg belangrijk om zo te zorgen dat het team goed is afgestemd en zo effici\xebnt mogelijk samenwerkt om een zo goed mogelijk resultaat te bekomen. Ook hou ik ervan om zelf de verantwoordelijkheid te nemen om zelfstandig deeltaken op te nemen en om actief tot de resultaten van het team bij te dragen."]),t.s)
B.Cz=A.a(s([-1,0,0,1,0,0,-1,0,1,0,0,0,-1,1,0,1,1,1,1,0]),t.up)
B.CA=A.a(s(["Mijn grootste technische kwaliteiten liggen binnen mobile development, voornamelijk met het frontend framework Flutter, en game development met Unity en C#. Flutter is een vernieuwende hybride framework voor het ontwikkelen van mobile apps en zelfs web apps vanuit \xe9\xe9n codebase. Dit spreekt mij zeer hard aan en is een grote reden waarom ik me verder wil specialiseren in Flutter. Ik heb tijdens mijn stage al veel bijgeleerd over mobile development en Flutter en ben er ook achter gekomen dat ik dit heel graag doe. Ik zou dan ook graag werken als Flutter developer nadat ik ben afgestudeerd. Game development is voor mij eerder een hobby en ik heb niet de intentie om hier mijn dagelijkse job van te maken. Maar deze hobby heeft me wel al veel bijgeleerd dat zal het in de toekomst ongetwijfeld nog meer doen. Mijn games worden ontwikkeld met de programmeertaal C#. Hierdoor heb ik een aardige voorsprong met deze taal. Verder leer ik veel nieuwe strategie\xebn en technieken bij tijdens het programmeren die overal toegepast kunnen worden en niet afhankelijk zijn van een bepaalde programmeertaal.","Na het behalen van mijn diploma in juni 2023 ben ik van plan om te beginnen werken. Ik zou graag beginnen werken als Flutter developer of mobile developer in het algemeen. Ik zou hier graag mijn dagelijkse bezigheid van willen maken en mijn skills verder ontwikkelen in het werkveld. Aangezien ik al een goede band heb opgebouwd met mijn stagebedrijf IT Licious en zij sterk geloven in het Flutter framework is er wel een mogelijkheid dat ik hier aan de slag zou kunnen gaan. Anders zal ik zelf opzoek gaan naar een mooie job. Mijn eerste jaren als ontwikkelaar zou ik graag zoveel mogelijk willen bijleren om een ervaren ontwikkelaar te worden zodat ik later de verantwoordelijkheid krijg om zelf projecten te leiden of om als zelfstandige of freelancer te kunnen starten."]),t.s)
